INSERT INTO `products` (`id`, `name`, `price`, `description`, `category_id`, `created_at`, `category_slug`, `images`, `updated_at`, `quantity`) VALUES
(86, 'Điện thoại Iphone 14 Pro Max 128GB', '25000000.00', 'Điện thoại Iphone 14 Pro Max 128GB', 91, '2023-04-23 18:16:55', 'dien-thoai-thong-minh', '', '2023-04-23 18:16:55', 0),
(87, 'Laptop MSI Modern 14 B11MO màu bạc', '21090000.00', 'Bạn đang mong muốn sở hữu cho mình chiếc laptop có tốc độ hoạt động nhanh chóng nhưng kèm theo đó là sự mỏng nhẹ, phong cách thì laptop MSI Modern 14 B11MO 294VN chính là lựa chọn hoàn hảo dành đến bạn lúc này.	', 92, '2023-04-23 18:24:20', 'lap-top-pc', '', '2023-04-23 18:24:20', 0),
(88, 'Tivi siêu mỏng LG UHD 4K 65inch | 65UQ9100', '17900000.00', 'Điều khiển dễ dàng chỉ bằng giọng nói của bạn. Điều khiển bằng giọng nói thông minh thông qua Trợ lý Google, Amazon Alexa, Apple AirPlay và nhiều ứng dụng khác, giúp cho việc điều khiển TV LG UHD dễ dàng và nhanh hơn bao giờ hết.', 93, '2023-04-23 18:31:04', 'tivi-thiet-bi-gia-dung', '', '2023-04-23 18:31:04', 0),
(89, 'La Roche-Posay Anthelios Xl SPF50+ Dry Touch', '515000.00', 'Sản phẩm độc đáo với công nghệ XL-PROTECT TM chống nắng tối ưu – bảo vệ da trước tác hại từ ánh nắng & ô nhiễm kết hợp với nước khoáng giúp làm dịu và chống oxy hoá. Kết cấu lỏng nhẹ, khô thoáng, kiểm soát dầu, không gây bết dính, bóng nhờn để bạn luôn tự tin tỏa sáng.', 94, '2023-04-23 18:35:10', '', '', '2023-04-23 18:35:10', 0),
(90, 'Đai đi xe máy an toàn cho bé (từ 1 đến 10 tuổi) Babyup', '129000.00', 'Đai đi xe máy cho bé, cho bé an toàn và thoải mái khi ngồi sau lưng. Tấm đỡ lưng dài hơn để tăng độ an toàn, tránh bé lật ngửa về sau khi xe tăng ga đột ngột, hoặc lên dốc cao. Có 3 dây, 2 dây quàng qua 2 vai để cố định đại chắc chắn trên lưng bé, 1 dây vòng qua bụng cha mẹ (người lớn) giữ bé ngồi vững vàng trên xe.', 95, '2023-04-23 18:49:09', '', '', '2023-04-23 18:49:09', 0),
(91, 'Bàn Chải Đánh Răng Điện Xiaomi Mijia T100', '149000.00', 'Bàn chải điện T100 đặc biệt được Xiaomi trang bị động cơ rung với tần số cao 16500 vòng/phút cho khả năng hoạt động hiệu quả và làm sạch 360 độ cho các bộ phận trong khoang miệng. Mức âm thanh 60dB khá êm ái, giảm độ giật nên sẽ không gây nhiều tiếng ồn ảnh hưởng đến thao tác sử dụng. 2 chế độ chải mạnh mẽ, tiêu chuẩn đáp ứng đầy đủ nhu cầu cho người dùng.', 96, '2023-04-23 18:54:45', '', '', '2023-04-23 18:54:45', 0),
(92, 'Giày cao gót slingback Erosska cao 5cm màu kem', '219000.00', 'Nhã nhặn, lịch thiệp nhưng vẫn giữ cho các nàng nét nữ tính, trẻ trung, giày cao gót quai vắt sau gót được thiết kế hở gót với phần quai mảnh vắt phía sau đem đến cảm giác thoải mái, không bị ngột ngạt. Phần đế giày thường không quá cao để bạn có thể thoải mái di chuyển và rất tiện phối đồ nhiều phong cách.', 97, '2023-04-23 19:10:04', '', '', '2023-04-23 19:10:04', 0),
(93, 'Mũ lưỡi trai thể thao trơn màu đen CAPMAN', '105000.00', 'THÔNG TIN SẢN PHẨM : - Chất liệu: được dệt từ vải kaki cao cấp. - Không gây kích ứng da đầu, không ra màu. - Size: freesize, dễ dàng điều chỉnh size bằng khóa sau mũ, vòng đầu 52-58cm thích hợp cho cả nam nữ. - Do màn hình và điều kiện ánh sáng khác nhau, màu sắc thực tế của sản phẩm có thể chênh lệch khoảng 3-5%.', 98, '2023-04-24 03:04:30', '', '', '2023-04-24 03:04:30', 0),
(94, 'Balo DRU nam nữ chống nước kiểu dáng thể thao', '210000.00', 'Thông tin sản phẩm của balo nam nữ đi học ulzzang :\r\n\r\n- Sản phẩm có kích thước: 43cm x 29cm x 16cm (cao x dài x rộng)\r\n\r\n- Trọng lượng: ~ 560g \r\n\r\n- Chất liệu: vải nylon cao cấp chống nước.\r\n\r\n- Sản phẩm phù hợp với nhiều đối tượng: học sinh, sinh viên, văn phòng, nam nữ, unisex ...\r\n\r\n- Mục đích sử dụng: đi học, đi làm, đi chơi.\r\n\r\n-Có 2 màu : đen và ghi. Màu sắc trẻ trung, cá tính, dễ phối đồ.', 99, '2023-04-24 03:10:33', '', '', '2023-04-24 03:10:33', 0),
(95, 'Xe điện cân bằng Funiko BW7,7 kết nối Bluetooth', '2080000.00', 'Hệ thống đường xá ngày một sạch đẹp thuận tiện thì việc sở hữu một chiếc Xe điện cân bằng cao cấp là vô cùng cần thiết. Giúp bạn có thể di chuyển khoảng cách ngắn, len lỏi mọi ngõ ngách dễ dàng, thể hiện cá tính, đón đầu xu hướng công nghệ, tiết kiệm xăng và bảo vệ môi trường. \r\n\r\nXe điện cân bằng cao cấp, Xe cân bằng điện Funiko BW7 có thiết kế 2 bánh lớn 7 inch là phiên bản mới nhất 2022 với tính năng tự cân bằng giống chiếc Mini Robot Pro.Tính năng này giúp cho người lái nhất là những người mới chơi dễ dàng đứng lên xe mà không lo bị xe bị trượt về phía trước.', 100, '2023-04-24 03:16:14', '', '', '2023-04-24 03:16:14', 0),
(96, 'Gấu bông yoroshiko cao cấp hàng Quảng Châu', '199000.00', 'Thông tin sản phẩm:Gấu Bông Gấu Dâu, Gấu Lotso Đeo Yếm Cao Cấp- Hàng Nhập Khẩu Dễ Thương\r\n\r\nSize: 55cm 75cm\r\n\r\nChất liệu: vỏ gấu làm từ vải lông thỏ mềm mại, sờ vào rất mướt tay. Bông gòn trắng cao cấp, độ đàn hồi cao, tạo cảm giác êm ái khi sử dụng\r\n\r\nTất cả các sản phẩm điều được ép chân không khi vận chuyển để giảm thiểu chi phí, Khi khách mở ra cần đợi khoảng nữa ngày để gấu bung gòn về phom', 101, '2023-04-24 03:22:58', '', '', '2023-04-24 03:22:58', 0),
(97, 'Máy sấy tóc mini JIASHI tạo kiểu tóc 1500w', '79000.00', 'THÔNG TIN SẢN PHẨM MÁY SẤY TÓC JIASHI: \r\n- Thương hiệu: JIASHI \r\n- Kích thước khi lắp cả đầu sấy: 24*16.5cm (chi tiết xem ở ảnh)\r\n- Công suất lớn: 1500W\r\n- Điện áp định mức: 220V\r\n- Hai chế độ sấy: Nóng và Lạnh\r\n+ Mức 1: Sấy lạnh\r\n+ Mức 2: Sấy nóng', 102, '2023-04-24 03:40:13', '', '', '2023-04-24 03:40:13', 0),
(99, 'Laptop MSI Modern 14 B11MO màu bạc', '21090000.00', 'Bạn đang mong muốn sở hữu cho mình chiếc laptop có tốc độ hoạt động nhanh chóng nhưng kèm theo đó là sự mỏng nhẹ, phong cách thì laptop MSI Modern 14 B11MO 294VN chính là lựa chọn hoàn hảo dành đến bạn lúc này.', 92, '2023-04-24 07:23:31', 'lap-top-pc', '', '2023-04-24 07:23:31', 0),
(102, 'Điện Thoại Realme C55 (6GB/128GB) - Sang trọng', '4290000.00', 'Màu sắc Vàng Nắng Mai - Đen Trời Đêm\r\nMàn hình Tấm nền màn hình (IPS LCD, Super AMOLED, OLED, Retina,...)LCD\r\nĐộ phân giải màn hình (pixels)FHD+ 1080*2400\r\nKích thước màn hình (inch)6.72 inch（17.07cm)\r\nTốc độ làm tươi (số khung hình / giây) của màn hình (Hz)90Hz\r\nĐộ sáng màn hình tối đa (nits)680nit\r\nMặt kính cảm ứng (Kính thường, Kính cường lực Gorilla Glass 3,...)', 91, '2023-05-06 23:27:02', 'dien-thoai-thong-minh', '', '2023-05-06 23:27:02', 0),
(103, 'Đồng hồ thông minh Xiaomi Redmi Watch 3', '2790000.00', 'Tầm giá chưa đến 3 triệu đồng thì một chiếc smartwatch vừa có nghe gọi vừa được trang bị GPS độc lập khá hiếm thấy nhưng gần đây Xiaomi đã cho ra mắt sản phẩm đồng hồ thông minh Xiaomi Redmi Watch 3 có cả hai tính năng trên. Bên cạnh đó còn được trang bị nhiều tính năng hỗ trợ theo dõi sức khỏe và luyện tập phục vụ cho người dùng. Ngoại hình tương đồng với các thế hệ trước.', 98, '2023-05-06 23:31:31', 'thoi-trang-va-phu-kien-nam', '', '2023-05-06 23:31:31', 0),
(104, 'Tai nghe Bluetooth Beats High-Performance', '3190000.00', 'Với thiết kế tối giản, kiểu dáng hiện đại, chất âm thu hút, lôi cuốn,... tai nghe Bluetooth Beats High-Performance chắc hẳn sẽ là người bạn đồng hành lý tưởng cho bạn một không gian âm nhạc tuyệt vời. Tai nghe được thiết kế đơn giản, hướng đến sự tiện lợi cho người dùng. Đệm tai êm ái, móc tai có thể điều chỉnh, bám sát vào tai, tối đa hóa sự thoải mái và ổn định khi đeo, tránh rơi rớt.', 93, '2023-05-06 23:33:20', 'tivi-thiet-bi-gia-dung', '', '2023-05-06 23:33:20', 0);

